        uint256 tokensForLiquidity = _liquidityTokensToSwap.div(2);
        uint256 amountToSwapForBNB = contractBalance.sub(tokensForLiquidity);

        uint256 initialBNBBalance = address(this).balance;

        swapTokensForBNB(amountToSwapForBNB); 

        uint256 bnbBalance = address(this).balance.sub(initialBNBBalance);

        uint256 bnbForOperations = bnbBalance.mul(_marketingTokensToSwap).div(totalTokensToSwap);

        uint256 bnbForBuyBack = bnbBalance.mul(_buyBackTokensToSwap).div(totalTokensToSwap);
        uint256 bnbForMarketing = bnbForOperations * 20 / 70;
        uint256 bnbForTeam = bnbForOperations * 25 / 70;
        uint256 bnbForDevelopment = bnbForOperations * 25 / 70;

        uint256 bnbForLiquidity = bnbBalance.sub(bnbForMarketing).sub(bnbForBuyBack).sub(bnbForTeam).sub(bnbForDevelopment);

        _liquidityTokensToSwap = 0;
        _marketingTokensToSwap = 0;
        _buyBackTokensToSwap = 0;
        _developmentTokensToSwap = 0;
        _teamTokensToSwap = 0;


        (bool success,) = address(buybackAddress).call{value: bnbForBuyBack}("");
